import React from 'react';
import { Link,useNavigate } from 'react-router-dom';

const DeleteContact = (props) => {
    const nav = useNavigate()
    const a = props.delData;
    console.log(a);

    const DeleteHandler = () => {
        props.delContact(a);

        nav("/");
    }




    return(
        <div>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>

            <div className="ui content">
            <div align="center"><h2 className="header">Are you sure to delete this contact</h2></div>
            <br/>

            <div style={{display:"flex",flexDirection:"row",flex:"1",justifyContent:"center",alignItems:"center"}}>
            <Link to="/">
            <button  className="ui button black"> GoBack</button></Link>

            <button className="ui button red" onClick={DeleteHandler}>Delete </button>

            </div>
            </div>



        </div>
    );
}

export default DeleteContact;
